import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import Inicio from "./componentes/inicio";
import logo from '/assets/logo.png';
import './App.css';

function App() {

  return (
    <>
    <BrowserRouter>
      <header>
        <image src={logo}  style={{width:'100px', height:'100px'}}/>
        <h2>Vivian´s Peluquieria</h2>
        <h3>Salón de belleza</h3>
      </header>
      <Routes>
        <Route path="/" element={<Navigate to="/vivians/inicio" replace />} />
        <Route path="/vivians/inicio" element = {<Inicio/>}/>
        <Route path="/vivinas/iniciarsesion" element={ <Inicio/>}/>
        <Route path="/vivians/registrar" element = {<Inicio/>}/>
      </Routes>
      <footer>
        <div class="footer-links">
          <p>Redes Sociales</p>

        </div>
        <div>
          <p>Dirección<br/>Vivian's<br/>Viñedos y Venezuela</p>

        </div> 
      </footer>
    </BrowserRouter>
    </>
  );
}

export default App;
